import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        getCorona(); //LOL

    }, []);

    getCorona = async () => {
        let result = await axios.get('https://coronavirus-tracker-api.herokuapp.com/all');

        setData(data)
    }

    function getCorona() {
         axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
            .then(latest => {
                const sick = latest.data;

                setData(sick)
            })

    }

    return (
    <div>
        <h1>CORONA</h1>
        {data.confirmed}
    </div>
    );
}

export default App;
